import React from "react";
import ReactDOM from "react-dom";
import '../src/index.css';

const name = "Khushi Vijay";

const occupation = "Btech Student";
const section = "3rd Year";
const currentDate = new Date().getDate();
const currenttime = new Date().toLocaleTimeString();

const img1 = "https://picsum.photos/id/75/450/300";
const img2 = "https://picsum.photos/id/74/450/300";
const img3 = "https://picsum.photos/id/73/450/300";
const img4 = "https://picsum.photos/id/72/450/300";


ReactDOM.render(
  <>
  <h1> Welcome to My Channel CodewithHappiness</h1>
  <p>It's Gonna be my first video</p>
  <ol>
    <li>Level 1</li>
    <li>Level 2</li>
    <li>Level 3</li>
    <li>Level 4</li>
  </ol>
  <h1>{name}</h1>

  <h1>{`I'm a ${section} ${occupation}`}</h1>

  <h1>{currentDate} {currenttime} </h1>

  <a href="#ipsum" target="_blank">
    <img src="https://picsum.photos/id/77/450/300" alt="Random Image"/>
    <img  src={img1} alt="RAndom Image"/>
    <img src={img2} alt="Random Image"/>
    <img src={img3} alt="Randoma Image"/>
    <img src={img4} alt="Random Image"/>
  </a>

  <div className="header">
    <h1>Hello Everyone,</h1>
  </div>

  </>,document.getElementById("root")
);
